import React, { Component } from "react";

class Soccer extends Component {
  render() {
    return (
      <div>
        <h2>Soccer</h2>
        <p>Last but not least Soccer is the 3rd sport in my top three sports list. I am not so good at playing this sport but I do like to watch is as much as I can. In the USA soccer is not as big here as it would be overseas </p>
      </div>
    );
  }
}

export default Soccer;
